#include "stdio.h"
#include "stdlib.h"
#include "math.h"
/*======================================================
// function name：jacobi
// input：A maxtrix，b matrix, x is phi
//           n is the number of x，eps is accuracy。
//           iter is the number of iteration
// return: the number of iteration
=========================================================*/
int jaco(double *a, double *b,double *x,int n,double eps, int iter)
{
  int i,j,piter=0;
  double fr = 1.0, t, *x2;
  if((a==NULL)||(b==NULL)||(x==NULL))           
  {
    printf("The pointer is NULL\n");
    return(0);
  }
    x2 = (double *)malloc(n*sizeof(double));      
  if(x2==NULL)
  {
    printf("Memory alloc failed\n");
    return(0);
  }
  for(i=0; i<n; i++)
    if(fabs(a[i*n+i]) < 1e-12)              
  {
    printf("A[%d,%d] is too small,cannot converged",i,i);
    return(0);
  }
    for(i=0; i<n; i++)                        //initialize
  x[i] = 0.0;
  while((fr>eps) && (piter<iter))
  {
    fr = 0.0;

    printf("#%d iteration\n",piter+1);

    printf("The error value t：\n"); 

    for(i=0; i<n; i++)
    {
      t = 0.0;
      for(j=0; j<i; j++)
        t = t+a[i*n+j]*x[j];
      for(j=i+1; j<n; j++)
        t = t+a[i*n+j]*x[j];
        x2[i] = (b[i] - t)/a[i*n+i];            //update x value
        t = fabs(x2[i]-x[i])/(1.0+fabs(x[i]));  //update the error value 
      if(t > fr)
        fr = t;
      printf("t[%d]=%f ", i+1, t);
    }

    printf("\n");
    printf("approximate value of x：\n"); 

    for(i=0; i<n; i++)
    {
      x[i] = x2[i];
      printf("x[%d]=%f ",i+1,x[i]);
    }
    piter++;                               //iteration number +1
    printf("\n\n");
  }

  return(piter);
}

